import React from "react";
import ReactDOM from "react-dom";
//import Image from "./Mep";


const M=Image.map(function(props){
  return(
  <>
  <div>
  
<img src={props.img} alt="nothing to show"/>

<h1>{props.imgno}</h1>
  </div>
  </>
  )
})


ReactDOM.render(
<div>

<M />


</div>,
document.getElementById('root'));
